import React, { useEffect ,useState} from 'react'

function Show  () {

    var [data, setData] =useState([]);

    useEffect(()=>{
        fetch('')
        .then(res=>res.json())
        .then(val=>{
            console.log(val);
            console.log(val.employees);
            setData(val.employees);
        })
    },[]);
  return (
    <div className='container'>
    
    </div>
  )
}

export default Show
